import React,{Component} from "react";

class Form extends Component{
    render(){
        return(
            <form>
                <input type="text" name="candName"/><br/>
                <input type="text" name="candAge"/><br/>
                <select name="candRole">
                    <option>React Dev</option>
                    <option>Node Developer</option>
                    <option>MERN dev</option>
                </select>
            </form>
        )
    }
}

export default Form
